import React from 'react';


const Toolbar = (props) => (
    <header>
            <div>Child.LK</div>
            <li>Home</li>
            <div>My Cart</div>
            <div>My Orders</div> 
            <div>About Us</div>   
    </header>
);

export default Toolbar;
